  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0110257 includes chemical,
  discrete sample, physical and profile data collected from THALASSA in the North
  Atlantic Ocean from 2008-06-10 to 2008-07-11 and retrieved during cruise OVIDE_08.
  These data include ALKALINITY, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE,
  PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE
  and pH. The instruments used to collect these data include Alkalinity titrator,
  CTD, Spectrophotometer for pH measrement and bottle. These data were collected by
  Aida F. Rios of Instituto de Investigaciones Marinas; Departamento de Oceanograffa
  and H. Mercier [affiliation unknown] as part of the CLIVAR_OVIDE_2008 data set.nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
